"use client";

"use client";
import React, { useEffect } from "react";
import { supabase } from "../utils/supabaseClient";
import { useRouter } from "next/navigation";

export default function LandingPage() {
  const router = useRouter();

  useEffect(() => {
    supabase.auth.getUser().then(({ data }) => {
      if (data?.user) {
        router.push("/dashboard");
      }
    });
  }, [router]);

  const handleLogin = async () => {
    await supabase.auth.signInWithOAuth({ provider: "google" });
  };

  return (
    <div className="min-h-screen w-full flex flex-col items-center justify-center bg-[url('data:image/jpeg;base64,')] bg-cover bg-center px-2 md:px-0">
      {/* Navigation Bar */}
      <nav className="w-full max-w-7xl mx-auto flex items-center justify-between py-8 px-6 md:px-12 fixed top-6 left-0 right-0 bg-white/60 rounded-2xl backdrop-blur-lg z-20 border-b border-white/20 shadow-2xl shadow-black/20">
        <div className="text-2xl font-bold text-gray-900 tracking-tight">
          Evento
        </div>
        <div className="hidden md:flex gap-8 text-gray-700 font-medium">
          <a href="#" className="hover:text-blue-600">
            Product
          </a>
          <a href="#" className="hover:text-blue-600">
            Features
          </a>
          <a href="#" className="hover:text-blue-600">
            Pricing
          </a>
          <a href="#" className="hover:text-blue-600">
            Resources
          </a>
        </div>
        <div className="flex gap-4">
          <button
            onClick={handleLogin}
            className="px-5 py-2 rounded-xl bg-white text-gray-900 font-semibold shadow hover:bg-gray-100 transition"
          >
            Sign in
          </button>
          <button className="px-5 py-2 rounded-xl bg-black text-white font-semibold shadow hover:bg-gray-900 transition">
            About
          </button>
        </div>
      </nav>
      {/* Main Content */}
      <div className="w-full max-w-5xl mx-auto flex flex-col items-center justify-center pt-32 pb-16">
        {/* Feature Icons and Central Icon */}
        <div className="relative w-full flex flex-col items-center mb-8">
          <div className="flex justify-center items-center gap-12 mb-8">
            <FeatureIcon color="bg-yellow-200" icon="💡" />
            <FeatureIcon color="bg-blue-200" icon="🎈" />
            <CentralIcon />
            <FeatureIcon color="bg-orange-200" icon="⚡" />
            <FeatureIcon color="bg-gray-100" icon="👀" />
          </div>
        </div>
        {/* Headline and Description */}
        <h1 className="text-4xl md:text-5xl font-bold text-gray-50 text-center mb-4">
          All-in-one Event Platform
        </h1>
        <p className="text-lg text-gray-100 text-center max-w-xl mb-8">
          Evento is a modern, all-in-one event platform designed to perfectly
          fit your needs. Discover, create, and join events with ease.
        </p>
        <button
          onClick={handleLogin}
          className="px-8 py-3 rounded-xl bg-gradient-to-r from-pink-500 to-purple-600 text-white font-bold shadow-lg text-lg hover:scale-105 transition-transform"
        >
          Sign in with Google
        </button>
      </div>
    </div>
  );
}

function FeatureIcon({ color, icon }) {
  return (
    <div
      className={`w-16 h-16 rounded-xl flex items-center justify-center text-2xl shadow ${color}`}
    >
      {icon}
    </div>
  );
}

function CentralIcon() {
  return (
    <div className="w-20 h-20 rounded-2xl flex items-center justify-center bg-gradient-to-br from-purple-400 to-indigo-400 shadow-lg">
      <svg width="40" height="40" viewBox="0 0 24 24" fill="none">
        <circle cx="12" cy="12" r="10" fill="#fff" />
        <path
          d="M8 12l2 2 4-4"
          stroke="#7c3aed"
          strokeWidth="2"
          strokeLinecap="round"
          strokeLinejoin="round"
        />
      </svg>
    </div>
  );
}
